(1, 'Cases - Send Copy of an Activity', '{if $idHash}[case #{$idHash}]{/if} {$activitySubject}\n', '===========================================================\r\n{ts}Activity Summary{/ts} - {$activityTypeName}\r\n===========================================================\r\n{if $isCaseActivity}\r\n{ts}Your Case Role(s){/ts} : {$contact.role}\r\n{if $manageCaseURL}\r\n{ts}Manage Case{/ts} : {$manageCaseURL}\r\n{/if}\r\n{/if}\r\n\r\n{if $editActURL}\r\n{ts}Edit this Activity{/ts} : {$editActURL}\r\n{/if}\r\n{if $viewActURL}\r\n{ts}View this Activity{/ts} : {$viewActURL}\r\n{/if}\r\n\r\n{foreach from=$activity.fields item=field}\r\n{if $field.type eq ''Date''}\r\n{$field.label}{if $field.category}({$field.category}){/if} : {$field.value|crmDate:$config->dateformatDatetime}\r\n{else}\r\n{$field.label}{if $field.category}({$field.category}){/if} : {$field.value}\r\n{/if}\r\n{/foreach}\r\n\r\n{foreach from=$activity.customGroups key=customGroupName item=customGroup}\r\n==========================================================\r\n{$customGroupName}\r\n==========================================================\r\n{foreach from=$customGroup item=field}\r\n{if $field.type eq ''Date''}\r\n{$field.label} : {$field.value|crmDate:$config->dateformatDatetime}\r\n{else}\r\n{$field.label} : {$field.value}\r\n{/if}\r\n{/foreach}\r\n\r\n{/foreach}', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n <meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />\r\n <title></title>\r\n</head>\r\n<body>\r\n\r\n{capture assign=headerStyle}colspan="2" style="text-align: left; padding: 4px; border-bottom: 1px solid #999; background-color: #eee;"{/capture}\r\n{capture assign=labelStyle }style="padding: 4px; border-bottom: 1px solid #999; background-color: #f7f7f7;"{/capture}\r\n{capture assign=valueStyle }style="padding: 4px; border-bottom: 1px solid #999;"{/capture}\r\n\r\n<center>\r\n <table width="620" border="0" cellpadding="0" cellspacing="0" id="crm-event_receipt" style="font-family: Arial, Verdana, sans-serif; text-align: left;">\r\n\r\n  <!-- BEGIN HEADER -->\r\n  <!-- You can add table row(s) here with logo or other header elements -->\r\n  <!-- END HEADER -->\r\n\r\n  <!-- BEGIN CONTENT -->\r\n\r\n  <tr>\r\n   <td>\r\n    <table style="border: 1px solid #999; margin: 1em 0em 1em; border-collapse: collapse; width:100%;">\r\n     <tr>\r\n      <th {$headerStyle}>\r\n       {ts}Activity Summary{/ts} - {$activityTypeName}\r\n      </th>\r\n     </tr>\r\n     {if $isCaseActivity}\r\n      <tr>\r\n       <td {$labelStyle}>\r\n        {ts}Your Case Role(s){/ts}\r\n       </td>\r\n       <td {$valueStyle}>\r\n        {$contact.role}\r\n       </td>\r\n      </tr>\r\n      {if $manageCaseURL}\r\n      <tr>\r\n        <td colspan="2" {$valueStyle}>\r\n      <a href="{$manageCaseURL}" title="{ts}Manage Case{/ts}">{ts}Manage Case{/ts}</a>\r\n        </td>\r\n      </tr>\r\n      {/if}\r\n     {/if}\r\n     {if $editActURL} \r\n     <tr>\r\n       <td colspan="2" {$valueStyle}>\r\n     <a href="{$editActURL}" title="{ts}Edit this activity{/ts}">{ts}Edit this activity{/ts}</a>\r\n       </td>\r\n     </tr>\r\n     {/if}\r\n     {if $viewActURL}\r\n     <tr>\r\n       <td colspan="2" {$valueStyle}>\r\n     <a href="{$viewActURL}" title="{ts}View this activity{/ts}">{ts}View this activity{/ts}</a>\r\n       </td>\r\n     </tr>  \r\n     {/if} \r\n     {foreach from=$activity.fields item=field}\r\n      <tr>\r\n       <td {$labelStyle}>\r\n        {$field.label}{if $field.category}({$field.category}){/if}\r\n       </td>\r\n       <td {$valueStyle}>\r\n        {if $field.type eq ''Date''}\r\n         {$field.value|crmDate:$config->dateformatDatetime}\r\n        {else}\r\n         {$field.value}\r\n        {/if}\r\n       </td>\r\n      </tr>\r\n     {/foreach}\r\n\r\n     {foreach from=$activity.customGroups key=custo