}%1 every %2 %3 for %4 installments.{/ts}</p>\n\n       {if $frequency_day}\n        <p>{ts 1=$frequency_day 2=$frequency_unit}Payments are due on day %1 of the %2.{/ts}</p>\n       {/if}\n      </td>\n     </tr>\n\n     {if $payments}\n      {assign var="count" value="1"}\n      {foreach from=$payments item=payment}\n       <tr>\n        <td {$labelStyle}>\n         {ts 1=$count}Payment %1{/ts}\n        </td>\n        <td {$valueStyle}>\n         {$payment.amount|crmMoney} {if $payment.status eq 1}{ts}paid{/ts} {$payment.receive_date|truncate:10:''''|crmDate}{else}{ts}due{/ts} {$payment.due_date|truncate:10:''''|crmDate}{/if}\n        </td>\n       </tr>\n       {assign var="count" value=`$count+1`}\n      {/foreach}\n     {/if}\n\n     <tr>\n      <td colspan="2" {$valueStyle}>\n       <p>{ts 1=$domain.phone 2=$domain.email}Please contact us at %1 or send email to %2 if you have questions\nor need to modify your payment schedule.{/ts}</p>\n      </td>\n     </tr>\n     {if $honor_block_is_active}\n      <tr>\n       <th {$headerStyle}>\n        {$honor_type}\n       </th>\n      </tr>\n      <tr>\n       <td colspan="2" {$valueStyle}>\n        <p>{$honor_prefix} {$honor_first_name} {$honor_last_name}</p>\n        {if $honor_email}\n         <p>{ts}Honoree Email{/ts}: {$honor_email}</p>\n        {/if}\n       </td>\n      </tr>\n     {/if}\n\n     {if $customGroup}\n      {foreach from=$customGroup item=value key=customName}\n       <tr>\n        <th {$headerStyle}>\n         {$customName}\n        </th>\n       </tr>\n       {foreach from=$value item=v key=n}\n        <tr>\n         <td {$labelStyle}>\n          {$n}\n         </td>\n         <td {$valueStyle}>\n          {$v}\n         </td>\n        </tr>\n       {/foreach}\n      {/foreach}\n     {/if}\n\n    </table>\n   </td>\n  </tr>\n\n </table>\n</center>\n\n</body>\n</html>\n', 1, 405, 0, 1, NULL);
